listing_square_feet:
coalesce(case when SquareFootageFinished='0' then null else SquareFootageFinished end, 
case when ApproximateBuildingSquareFeet > 0 then ApproximateBuildingSquareFeet 
else null end, squarefootage)

listing_price:
IF(
   if(status='Closed',
   coalesce(sold_price,lease_price,list_price, original_list_price),
   coalesce(list_price, lease_price, monthly_lease_price,original_list_price)) > 2000000000,
   NULL,
  if(status='Closed',
   coalesce(sold_price,lease_price,list_price, original_list_price),
   coalesce(list_price, lease_price, monthly_lease_price,original_list_price))
)

listing_square_feet:
coalesce(SqFtTotal,
		 if(Approximatesqft regexp '^[0-9]+$' and length(Approximatesqft) < 8,Approximatesqft,null),
		 if(Totalapproxsqft regexp '^[0-9]+$' and length(Totalapproxsqft) < 8,Totalapproxsqft,null)
		)

listing_price:
if(hs_rets_class = 'D',
   leaserent_price,
   if(status = 'sold',
	  if(sold_price < 100000000, sold_price, null),
	  if(listing_price < 100000000, listing_price, null)
   )
)
